import React, { useState, useEffect } from 'react';
import TweetItem from './TweetItem';


function TweetList(props) {
    const [tweetList, setTweetList] = useState(props.list);
    useEffect(() => {
        console.log
        setTweetList(props.list);
    }, [props.list]);
    //useEffect to get all tweets?
    //const tweetList = [{ picture: "", username: "Or Malka", tweetData: "hi you!" }, { picture: "", username: "Or Malka", tweetData: "What?" },
    //{ picture: "", username: "Or Malka", tweetData: "Hi!!" }]

    return <div id="tweet-list" className="tweet-list">
        {tweetList.map((item) => { return <TweetItem pic={item.picture} username={item.username} content={item.tweetData} /> })}
    </div>
}


export default TweetList;
